async () => {

		if(selectEntityProofdoc1.files.length === 1) {
			await JSObjectKYCIndProp.deleteIfFileExist('PD1');	
			await	QueryInsertEntityKYCIndProp.run({ 
				docType: selectEntityProofdoc1Type.selectedOptionValue,
				docPathFilename: selectEntityProofdoc1.files[0].name
			});
			QueryEntityProofdoc1.run();
		}

		if(selectEntityProofdoc2.files.length === 1) {
			await JSObjectKYCIndProp.deleteIfFileExist('PD2');	
			await	QueryInsertEntityKYCIndProp.run({
				docType: selectEntityProofdoc2Type.selectedOptionValue,
				docPathFilename: selectEntityProofdoc2.files[0].name
			});
			QueryEntityProofdoc2.run();
		}

		if(selectEntityPAN.files.length === 1) {	  
			await JSObjectKYCIndProp.deleteIfFileExist('PAN');	
			await QueryInsertEntityKYCIndProp.run({
				docType: 'PAN',
				docPathFilename: selectEntityPAN.files[0].name
			});
			QueryEntityPAN.run();
		}

		if(selectEntityCnclChq.files.length === 1) {
			await JSObjectKYCIndProp.deleteIfFileExist('CC');	
			await QueryInsertEntityKYCIndProp.run({ 
				docType: 'CancelledCheque',
				docPathFilename: selectEntityCnclChq.files[0].name
			});
			QueryEntityCnclChq.run();
		}

		if(selectEntityImpExpCert.files.length === 1) {		
			await JSObjectKYCIndProp.deleteIfFileExist('IEC');	
			await QueryInsertEntityKYCIndProp.run({ 
				docType: 'ImportExportCertificate',
				docPathFilename: selectEntityImpExpCert.files[0].name
			});
			QueryEntityImpExpCert.run();
		}

		showAlert('KYC Documents Uploaded');
		navigateTo('Individual KYC Summary', {});
	}

